import * as React from "react";
import { ReactSketchCanvas } from "react-sketch-canvas";

import "./App.css";

const styles = {
  border: "0.0625rem solid #9c9c9c",
  borderRadius: "0.25rem",
};

const App = () => {
  return (
    <ReactSketchCanvas
      style={styles}
      // width={"100%"}
      // height={"100%"}
      strokeWidth={4}
      strokeColor="red"
    />
  );
};

export default App;
